static int64_t rnd_(int64_t a, int64_t b) noexcept {
	uint64_t n = (uint64_t)(b - a + 1);
	uint64_t m = 0 - ((0 - n) % n);
	uint64_t r;
	if (m == 0)
		r = (static_cast<uint64_t>(xs128_()) << 32) | static_cast<uint64_t>(xs128_());
	else
	{
		do
		{
			r = (static_cast<uint64_t>(xs128_()) << 32) | static_cast<uint64_t>(xs128_());
		} while (m <= r);
	}
	return static_cast<int64_t>(r % n) + a;
}

